import { useEffect } from 'react';
import './App.css';

function App() {

  let patientData: Patient[]

  useEffect(() => {
    setup();
  }, [])

  type Patient = {
    name: string,
    age: number,
    start_date?: string | undefined,
    patient_status: "awaiting" | "resolved" | "admitted",
    end_date?: string | undefined,
    reason: string,
  }

  const setup = async () => {
    patientData = await loadPatients();
  }

  const loadPatients = async (): Promise<Patient[]> => {
    const url = "http://localhost:4000/patients"
    const options = {
      method: 'GET',
      headers: {"Content-Type": "application/json"},
    }
    let patients: Patient[] = [];
    try {
      const response = await fetch(url, options);
      const data = await response.json();
      data.map((item: Patient) => {patients.push(item)});
    } catch (error) {
      console.error(error);
    }
    return patients;
  }

  return (
    <div className="App">
      <>
      </>
    </div>
  );
}

export default App;
